import React, {useEffect} from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ManageContacts from './ManageContacts';
import ManageCompanies from './ManageCompanies';
import {fetchCompanies} from './slices/companiesSlice'
import {fetchAllTags} from './slices/tagsSlice'
import ManageToDo from './ManageToDo';
import {useDispatch} from 'react-redux'
import NewCompanyForm from './NewCompanyForm'
import NewContactForm from './NewContactForm'
import NewTodoForm from './NewTodoForm'
import NewTagForm from './NewTagForm'
import NewUserForm from './NewUserForm'
import NewListForm from './NewListForm'
import {fetchAllContacts} from './slices/contactsSlice'




function HeroSection() {
  return (
    <div className="hero bg-base-200">
      <div className="hero-content text-center">
        <div className="max-w-md">
          <h1 className="text-5xl font-bold">Welcome to the System</h1>
          <p className="py-6">Manage your contacts, companies, todos, and more efficiently with our Capstone Matching System.</p>
          <Link to="/manage-companies" className="btn btn-primary">Get Started</Link>
        </div>
      </div>
    </div>
  );
}

function Layout() {
  return (
    <div className="flex flex-col h-screen" alt="Test">
      <header className="navbar bg-base-100">
      <div className="flex-none">
          <h1 className="text-lg">Welcome to the Capstone Matching System</h1>
        </div>
      </header>
      <div className="flex-grow p-4 overflow-y-auto">
      <div className="buttons space-x-2">
          <Link to="/manage-companies"><button className="btn btn-primary">Manage Companies</button></Link>
          <Link to="/manage-contacts"><button className="btn btn-secondary">Manage Contacts</button></Link>
          <Link to="/manage-todo"><button className="btn btn-accent">Manage ToDo</button></Link>
        </div>
      </div>
      <footer className="footer bg-base-300 text-base-content">
        <div className="items-center grid-flow-col">
          <p>Â© 2023 Capstone Matching System</p>
        </div>
      </footer>
    </div>
  );
}
function App() {

  const dispatch = useDispatch();

  useEffect(() => {
    //userId will act as a placeholder until feature is developed to create users via sign up form(unfinished stretch goals)
    const userId = 1;
    dispatch(fetchCompanies(userId));
    dispatch(fetchAllContacts(userId));
    dispatch(fetchAllTags());
  }, [dispatch]);
  return (
    <Router>
      <div className="flex flex-col h-screen">
      <Routes>
      <Route path="/" element={<Layout />} />
        <Route path="/manage-companies" element={<ManageCompanies />} />
        <Route path="/manage-contacts" element={<ManageContacts />} />
        <Route path="/manage-todo" element={<ManageToDo />} />
        <Route path = "/add-company" element={<NewCompanyForm/>} />
        <Route path = "/add-contact" element={<NewContactForm/>} />
        <Route path = "/add-user" element={<NewUserForm/>} />
        <Route path = "/add-todo" element={<NewTodoForm/>} />
        <Route path = "/add-list" element={<NewListForm/>} />
        <Route path = "/add-tag" element={<NewTagForm/>} />
      </Routes>
      </div>
    </Router>
  );
}

export default App;
